import React from 'react';
import './App.css';
import QuoteForm from './components/QuoteForm';
import Header from './components/Header'
import Footer from './components/Footer'
import MainMenu from './components/MainMenu'

function App() {
  return (
    <div className="App">
      <Header />
      <MainMenu />
      <Footer />
      <QuoteForm />
    </div>
  );
}

export default App;
